import React from "react";
import { Card, CardContent, RadioGroup, Radio, FormControlLabel, Typography } from "@mui/material";

const Question = ({ question, questionIndex, answer, onAnswer }) => {
  return (
    <Card>
      <CardContent>
        <Typography variant="h6">{`Q${questionIndex + 1}. ${question.question}`}</Typography>
        <RadioGroup
          value={answer}
          onChange={(e) => onAnswer(e.target.value)}
        >
          {question.options.map((option, index) => (
            <FormControlLabel
              key={index}
              value={option}
              control={<Radio />}
              label={option}
            />
          ))}
        </RadioGroup>
      </CardContent>
    </Card>
  );
};

export default Question;
